import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'; // App 컴포넌트 임포트
import './index.css'; // 기본 스타일 임포트 (선택 사항)

// ReactDOM을 사용해 App 컴포넌트를 public/index.html의 id가 "root"인 요소에 렌더링
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
